import React from 'react';
import classes from './ChatScreenBar.module.css';

 const chatScreenBar = props => {
     return (
         <div className={classes.ChatScreenBar}>
            <img src='https://www.google.com/search?q=cat+image&newwindow=1&tbm=isch&
            source=iu&ictx=1&fir=xLp7AwvUnBwpcM%253A%252ChVpvvL-HxQGRYM%252C_&usg=AI4_
            -kREI8iv4mIo6scATWPpwqxzeW6gpw&sa=X&ved=2ahUKEwic6LOY_
            oDgAhVE1iwKHehHB0MQ9QEwAHoECAAQBA&biw=1280&bih=721#' alt=''/>
            <i className="fa fa-ellipsis-h"></i>
         </div>
     )
 }

 export default chatScreenBar;
